// SPDX-License-Identifier: MIT
pragma solidity 0.7.6;

import "@openzeppelin/contracts/math/SafeMath.sol";
import "./D4ppGovernance.sol";

contract Governance is D4ppGovernance {
    using SafeMath for uint;

    /// @notice Possible states that a proposal may be in
    enum ProposalState { Pending, Active, Defeated, Timelocked, AwaitingExecution, Executed, Expired }

    struct Proposal {
        // Propose subject
        bytes32 description;
        // Creator of the proposal
        address proposer;
        // Id of the project the call is to be made
        uint projectId;
        // The block at which voting begins
        uint startTime;
        // The block at which voting ends: votes must be cast prior to this block
        uint endTime;
        // Current number of votes in favor of this proposal
        uint forVotes;
        // Current number of votes in opposition to this proposal
        uint againstVotes;
        // Total number of votes that has been registered;
        uint totalVotes;
        // Flag marking whether the proposal has been executed
        bool executed;
        // Flag marking whether the proposal voting time has been extended
        // Voting time can be extended once, if the proposal outcome has changed during CLOSING_PERIOD
        bool extended;
    }

    /// @notice Ballot receipt record for a voter
    struct Receipt {
        // Whether or not a vote has been cast
        bool hasVoted;
        // Whether or not the voter supports the proposal
        bool support;
    }


    /// @notice The official record of all proposals ever proposed
    mapping(uint => Proposal) public proposals;

    /// @notice Receipts of ballots for the entire set of voters
    mapping(address => Receipt) public receipts;

    /// @notice The latest proposal for each proposer
    mapping(address => uint) public latestProposalIds;

    /// @notice Timestamp when a user can withdraw tokens
    mapping(address => uint) public canWithdrawAfter;


    /// @notice An event emitted when a new proposal is created
    event ProposalCreated(
        bytes32 description,
        address indexed proposer,
        uint indexed projectId,
        uint startTime,
        uint endTime
    );

    /// @notice An event emitted when a vote has been cast on a proposal
    event Voted(uint indexed proposalId, address indexed voter, bool indexed support, uint votes);

    /// @notice An event emitted when a proposal has been executed
    event ProposalExecuted(uint indexed proposalId);

    constructor(address _token) {
        require(_token != address(0), "D4ppGovernance: token is the zero address");
        token = _token;
        totalProjectCount = 0;
        _initialize();
    }

    function _initialize() internal {
        address _proposer = address(0);
        uint _projectId = 0;
        uint _startTime = block.timestamp;
        uint _endTime = block.timestamp;
        bytes32 _description = bytes32("Initial proposal");
        // Create a dummy proposal so that indexes start from 1
        proposals[_projectId] = Proposal(
            _description,
            _proposer,
            _projectId,
            _startTime,
            _endTime,
            0,
            0,
            1,
            false,
            false
        );

        receipts[_proposer] = Receipt (true, true);
        
        emit ProposalCreated(
            _description, 
            _proposer,
            _projectId,
            _startTime,
            _endTime
        );
    }

    function createProposal(uint _targetId, bytes32 _proposeDescription) public {
        require(_proposeDescription != bytes32(""), "Governance: Invalid proposal data passed");
        _propose(_msgSender(), _targetId, _proposeDescription);
    }

    function _propose(address _proposer, uint _targetId, bytes32 _description) internal returns(uint) {
        
    }

}
